import React from "react";
import styled from "styled-components";

//bootstrap components
import {Container, Navbar, NavItem} from "react-bootstrap";


const NavContainer = styled(Container)`
    display: flex;
    flex-direction: row;
    justify-content: space-between;

`

const Nav = styled(Navbar)`
    height: 130px;
    width: 100%;
    background-color: gray !important;

`

const ImageWrapper = styled(Container)`
    flex-direction: row;

    align-items: center;
    padding: 6px;
    margin-left: 4px;
`
const LogoText = styled.p`
    font-weight: 600;
    font-size: 25px;

`

const NavBrandImageWrapper = styled.img`
    height: 100px;
    width: auto;
`

const NavbarLink = styled(NavItem)`
    margin-left: 5px;
    margin-right: 5px;

`






export const NavigationBar = () => {
    return (
        <>
            <Nav>
                <NavContainer>
                        <ImageWrapper>
                            <NavBrandImageWrapper src={`/assets/images/CornLogo.png`}></NavBrandImageWrapper>
                            <LogoText>Corn Finance</LogoText>
                        </ImageWrapper>
                        <NavbarLink href="#">Home</NavbarLink>
                        <NavbarLink href="#">Vaults</NavbarLink>
                        <NavbarLink href="#">Connect</NavbarLink>



                </NavContainer>

            </Nav>

        </>
    )
}

export default NavigationBar
